import * as api from "../Api/helperApis.js";

export const addNewTeam = (NewTeamName) => async (NewTeamName) => {
  try {
    const data = await api.createNewTeam(NewTeamName);
    
    return data;
  } catch (err) {
    console.log(err);
  }
};
